            <p className="m-0">Collaborated with the team to design new features for our web application and mobile app.</p>
            <p className="m-0">Ensured that all code is well documented, reusable, efficient, and follows best practices.</p>
            <p className="m-0">Participated in peer code reviews as appropriate for the task at hand and reviewed othersâ€™ code when requested.</p>
            <p className="m-0">Used Version control tools (Git, GitHub, Gitlab) appropriately depending on the task at hand and participated in daily standups when applicable.</p>
          </li>
        </ul>
    </section>
    </>
  );
}

export default Home;
